import React from "react";
import Title from "./Title";
import TabSection from "./Tab";
import MainContent from "./MainContent";


class Page extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <Title />
                <Tab tabName="wiki" />
                <MainContent json={this.props.json} />
            </div>
        );
    }
}


export default Page
